    return (
        <div class="flip-card">
            <div class="flip-card-inner">
                <div class="flip-card-front">
                    <h3>{props.title}</h3>
                </div>
                <div class="flip-card-back">
                    <p>{props.desc}</p>
                </div>
            </div>
        </div> 
    );
  }

export default StarterItem;
